const API_BASE_URL = process.env.NODE_ENV === "development" ? "https://localhost:44301/api/" : "https://chiropractor-api.azurewebsites.net/api/";

const Chiropractor_API_URL = API_BASE_URL + "chiropractors/";

export const getArray = async () => {
    const response = await fetch(Chiropractor_API_URL + "Get Chiropractors", {
        headers: {
            Accept: "application/json"
        },
    }).then((res) => res.json()).then(res => JSON.parse(res));
    return response;
}
